.text #back to text segment of memory
.global main 
.type main, @function
main:

#addresses: addr = 0x11100000 color = 0x11140000 NEED TO CHANGE TO THESE BEFORE USING WITH OTTER!!!

li t1, 0x4F #to check if we have done all columns in a given row
li t2, 0x11100000 #MMIO address for pixel block
li t3, 0x11140000 #MMIO address for pixel color data

li a0, 0 #a0 is the current pixel address we are writing to, a1 is the pixel color data to be written
li a1, 0
li a4, 0  #a4 is the column part of the address

loop_to_front:
		la a2, MYDATA
		#li a2, 0x6000 #a2 is the address in memory that we are pulling pixel data from; each pixel is stored as a single byte
		li a6, 12 #number of remaining frames to be processed; 

next_frame:	
		li a3, 4800 #a3 is the counter that counts how many pixels remain for a given frame
		li a5, 0 #a5 is the row part of the address


#loop for writing a frame to the buffer pixel by pixel
frame_write:	
		lbu a1, 0(a2) #load first pixel data
		slli t0, a5, 7 #shift rows and add with columns to get full address
		add a0, t0, a4
		sw a0, 0(t2) #send pixel block address to VGA
		sw a1, 0(t3) #send pixel color data to VGA
		
		addi a3, a3, -1 #decrement pixel counter
		addi a2, a2, 1	#increment pixel data address
		beq a4, t1, new_row 
			addi a4, a4, 1 #increment current column 
			j frame_write
		
new_row:	
		li a4, 0	#back to first column
		addi a5, a5, 1 	#move to next row	
		bnez a3, frame_write # not done with this frame
		addi a6, a6, -1 #decrement number of remaining frames
		li s0, 625000 #set delay number for ~.05second delay 625000
		call delay
		beqz a6, loop_to_front #restart animation
		j next_frame #go to next frame


##########################
#Function: Delay
#Argument: a0 - Delay of (4*a0) *T (the 2 cycles for return can be disregarded)
#Return value: none
#Changed Registers: s0
##########################

delay:	addi s0, s0, -1
	bnez s0, delay
	ret
